import React, { Component } from 'react';
import {Link} from "react-router-dom";

class HomePage extends Component {
    constructor() {
      super();
      this.state = {
        username: "",
        password: "",
        data: []
    };
    }


    render() {
      return (
        <div>
          
          <Link to="/Home">
        <img src="bmiIcon.png" width="10%" height="10%" className="center" alt=""></img>
    </Link>
            <nav className="navbar navbar-expand-m navbar-dark mb-3">
            
            <ul className="navbar-nav ml-auto">
              
            
              
            <li className="navbar-brand">
              
                <a className="nav-link" href="/BmiDetail">
                Bmi details
                </a>
                </li>
      
              <li className="navbar-brand">
                <a className="nav-link" href="/BmiPage">
                  Add new Bmi detail
                </a>
              </li>
              <li className="navbar-brand">
                <a className="nav-link" href="/Login">
                  Log in
                </a>
              </li>
              <li className="navbar-brand">
                <a className="nav-link" href="/ChartPage">
                  Chart
                </a>
              </li>

              
              </ul>

            
              
            
           
                   
          </nav>
          
 
          <h3 className="text-center display-2">
                    Bmi Calculator
          </h3>
          
  
        </div>
      );
    }
  }
  
  export default HomePage;
